import React from 'react';

function LoginPage (){
        const [username, setUsername] = useState('');
        const [password, setPassword] = useState('');
    return (
        <div>
            <h2>HTML Forms</h2>

            <form>
                <label for="username">Username</label><br>
                <input type="test" id="username" name="username" required onChange={(e)=> setUsername(e.target.value)}></input></br>
                <label for="password">Password</label><br></br>
                <input type="password" id="password" name="password" required onChange={(e)=> setPassword(e.target.value)}></input><br></br>
                <button>Submit</button>
            </form> 
        </div>
        );
}

export default LoginPage;
